import '../css/App.css';
import Grafik from '../components/Grafik';
import Tablo from '../components/Tablo';


export default function Admin() {
  return (
   <div>
     <div className=' flex '>
      <div className='admin-navbar'>navbar</div>
      <div className=' w-full md:w-11/12'>
      <div className=' w-full bg-slate-100 flex font-serif text-base '>
      <div className=' py-2 px-4 '><a href='#'>Anasayfa</a> </div>
      <div className=' py-2 px-4 '>Tablo</div>
      <div className=' py-2 px-4 '>Adminler</div>

      </div>
        <Grafik />
        <Tablo />
      </div>
    </div>


   </div>

  );
}
